import axios from 'axios';

const baseURL = 'https://api.themoviedb.org/3?apiKey=9c988f818929acf8dc05090616cfe8ad';


export const fetchData = async (query) => {
  try {
    const response = await axios.get(baseURL);
    return response.data;
  } catch (error) {
    throw error;
  }
};
